import React from 'react';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Switch from '@material-ui/core/Switch';


function ActivarTemas({disabled}) {
    const handleChange = event => {
        let values = event.target.checked
      }

    return(
        <FormControlLabel
     disabled={disabled}   control={<Switch checked={true} onChange={handleChange} name="Activar todos los temas" />}
        label="Activar todos los temas"
      />
    );
}

export default React.memo(ActivarTemas)
